import styled from "styled-components";

export const Container = styled.div`
  display: grid;
  justify-content: center;
  padding: 1.5rem;
  grid-template-columns: repeat(4, 1fr);
  row-gap: 24px;
`;

export const GridItem = styled.div`
    display: flex;
    justify-content: center;
`;
